def frequentWords(s,k):
    counts={}
    for i in range(len(s)-k+1):
        if s[i:i+k] not in counts:
            counts[s[i:i+k]]=0
        counts[s[i:i+k]]+=1
    m= max(counts.values())
    out=[]
    for kmer in counts:
        if counts [kmer]==m:
            out.append(kmer)
    return out
s=''
k=12
print(frequentWords(s,k))
